import React, {Component} from "react";

import Playercards from "./Playercards";
import Agents from "./Agents";
import Maps from "./Maps";
import Weapons from "./Weapons";
import Home from "./Home";
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";

class Navbar extends Component{



    render() {
        <Router>
        return (
            <div id="NavBar">
                <Playercards/>
                <ul id="bar">
                    <li onClick={changeContentAgents}>Agents</li>
                    <li onClick={changeContentCards}>Cards</li>
                    <li onClick={changeContentHome}>Home</li>
                    <li onClick={changeContentWeapons}>Weapons</li>
                    <li onClick={changeContentMaps}>Maps</li>
                </ul>
            </div>
        );
        </Router>
    }

}

function changeContentAgents() {

}

